import React, {Component} from 'react';
import './App.css';

class Header extends Component {
  render(){
    return(
      <header>
        <h1>{this.props.title}</h1>
        <div>{this.props.subtitle}</div>
      </header>
    )
  }
}

class Nav extends Component {
  render(){
    return(
      <nav>
        <ul>
          <li><a href="html.html">HTML</a></li>
          <li><a href="css.html">CSS</a></li>
          <li><a href="js.html">Javascript</a></li>
        </ul>
      </nav>
    )
  }
}

class Article extends Component {
  render(){
    return(
      <article>
        <h1>{this.props.title}</h1>
        {this.props.body}
      </article>
    )
  }
}

class App extends Component {
  render(){
    return (
      <div className="App">
        <Header title="react-app!" subtitle="react practicing and discovering"></Header>
        <Nav></Nav>
        <Article title="artcle title" body="article body are landing here"></Article>
      </div>
    );
  }
}

export default App;
